import React from 'react';
import classes from './FAQ_answer.module.css'
import questions from '../FAQ_Data.js'


const Answer = () => {

return(
	<div className={classes.Answer}>
	<div className={classes.header}>
       <p className={classes.title}>Answer</p> 
			 {/* <Back/> */}
			</div>
	<div className={classes.wrapper}>
		<div className={classes.intro}></div>
		<div id={1}>
			<title> BUY Как правильно ставить таски в ASANA?</title>
			<p><strong>ОБЯЗАТЕЛЬНО</strong>
      добавлять к каждой задаче какие-либо: 
      референсы — видео, картинки, схемы
      гайдлайны, логотипы оффера, брендбуки (если имеются)
      </p>
		</div>
	 
	</div>
	</div>
);
}


export default Answer;
